import React from 'react';

const EducationCourses = () => {
	return (
		<div>	
			<section id="EducationCourses">
				<nav className='bt bb tc mw7 center mt0'>
					<ul>
						<li><a className='one two hover-bg-light-green' href="#HardSkills" title="Hard Skills">Hard Skills</a></li>
						<li><a className='one two hover-bg-light-blue' href="#SoftSkills" title="Human Skills">Soft Skills</a></li>
						<li><a className='one two hover-bg-light-green' href="#Home" title="Home">Home</a></li>
					</ul>
				</nav>
			</section>
		</div>
	);
}

export default EducationCourses;
